@Override
public Object pop() {
    final int len = (int)length();
    if (len == 0) {
        return ScriptRuntime.UNDEFINED;
    }

    final int newLength = len - 1;
    final int elem = array[newLength];
    array[newLength] = 0;
    setLength(newLength);

    return elem;
}

@Override
public Object pop() {
