@Override
public MethodHandle getOptimisticGetter(final Class<?> type, final int programPoint) {
    if (type == int.class) {
        return INVOKE_INT_GETTER;
    } else if (type == long.class) {
        return INVOKE_LONG_GETTER;
    } else if (type == double.class) {
        return INVOKE_NUMBER_GETTER;
    } else {
        assert type == Object.class;
        return INVOKE_OBJECT_GETTER;
    }
}

@Override
public MethodHandle getSetter(final Class<?> type, final PropertyMap currentMap) {
    if (type == int.class) {
        return INVOKE_INT_SETTER;
    } else if (type == long.class) {
        return INVOKE_LONG_SETTER;
    } else if (type == double.class) {
        return INVOKE_NUMBER_SETTER;
    } else {
        assert type == Object.class;
        return INVOKE_OBJECT_SETTER;
    }
}

private static MethodHandle getCALL_CMP() {
    return Global.instance().getDynamicInvoker(CALL_CMP,
            new Callable<MethodHandle>() {
                @Override
                public MethodHandle call() {
                    return Bootstrap.createDynamicInvoker("dyn:call", double.class,
                        ScriptFunction.class, Object.class, Object.class, Object.class);
                }
            });
}

private static MethodHandle getREPLACER_INVOKER() {
    return Global.instance().getDynamicInvoker(REPLACER_INVOKER,
            new Callable<MethodHandle>() {
                @Override
                public MethodHandle call() {
                    return Bootstrap.createDynamicInvoker("dyn:call", Object.class,
                        ScriptFunction.class, ScriptObject.class, Object.class, Object.class);
                }
            });
}

private static MethodHandle getCALL_CMP() {
    return Global.instance().getDynamicInvoker(CALL_CMP,
            new Callable<MethodHandle>() {
                @Override
                public MethodHandle call() {
                    return Bootstrap.createDynamicInvoker("dyn:call", double.class,
                        ScriptFunction.class, Object.class, Object.class, Object.class);
                }
            });
}

private static MethodHandle getREVIVER_INVOKER() {
    return Context.getGlobal().getDynamicInvoker(REVIVER_INVOKER,
            new Callable<MethodHandle>() {
                @Override
                public MethodHandle call() {
                    return Bootstrap.createDynamicInvoker("dyn:call", Object.class,
                        ScriptFunction.class, ScriptObject.class, String.class, Object.class);
                }
            });
}

private boolean doesNotHaveCheckArrayKeys(final long longIndex, final int value, final int callSiteFlags) {
    if (getMap().containsArrayKeys()) {
        final String       key  = JSType.toString(longIndex);
        final FindProperty find = findProperty(key, true);
        if (find != null) {
            setObject(find, callSiteFlags, key, value);
            return true;
        }
    }
    return false;
}

