public static String getStringProperty(final String name, final String defValue) {
    checkPropertyName(name);
    return AccessController.doPrivileged(
            new PrivilegedAction<String>() {
                @Override
                public String run() {
                    try {
                        return System.getProperty(name, defValue);
                    } catch (final SecurityException e) {
                        // if no permission to read, assume the default value
                        return defValue;
                    }
                }
            }, READ_PROPERTY_ACC_CTXT);
}

public static int getIntProperty(final String name, final int defValue) {
    checkPropertyName(name);
    return AccessController.doPrivileged(
            new PrivilegedAction<Integer>() {
                @Override
                public Integer run() {
                    try {
                        return Integer.getInteger(name, defValue);
                    } catch (final SecurityException e) {
                        // if no permission to read, assume the default value
                        return defValue;
                    }
                }
            }, READ_PROPERTY_ACC_CTXT);
}

@Override
public int getInt(final double key, final int programPoint) {
    final int       index = getArrayIndex(key);
    final ArrayData array = getArray();

    if (array.has(index)) {
        return isValid(programPoint) ? array.getIntOptimistic(index, programPoint) : array.getInt(index);
    }

    return getInt(index, JSType.toString(key), programPoint);
}

